import React from "react";
import Button from "../UI/Button";
import style from "./Checkout.module.css";
import useInput from "../../hooks/useInput";

const Checkout = (props) => {
  const {
    value: nameValue,
    onBlurHandler: nameOnBlurHandler,
    onChangeInputHnadler: nameChangeHandler,
    hasError: nameHasError,
    setIsTouched: setNameIsTouched,
    valueIsValid: nameIsValid,
    reset: resetName,
  } = useInput((val) => val.trim() !== "");

  const {
    value: brgyValue,
    onBlurHandler: brgyOnBlurHandler,
    onChangeInputHnadler: brgyChangeHandler,
    hasError: brgyHasError,
    setIsTouched: setBrgyIsTouched,
    valueIsValid: brgyIsValid,
    reset: resetBrgy,
  } = useInput((val) => val.trim() !== "");

  const {
    value: cityValue,
    onBlurHandler: cityOnBlurHandler,
    onChangeInputHnadler: cityChangeHandler,
    hasError: cityHasError,
    setIsTouched: setCityIsTouched,
    valueIsValid: cityIsValid,
    reset: resetCity,
  } = useInput((val) => val.trim() !== "");

  const {
    value: provinceValue,
    onBlurHandler: provinceOnBlurHandler,
    onChangeInputHnadler: provinceChangeHandler,
    hasError: provinceHasError,
    setIsTouched: setProvinceIsTouched,
    valueIsValid: provinceIsValid,
    reset: resetProvince,
  } = useInput((val) => val.trim() !== "");

  const {
    value: postalValue,
    onBlurHandler: postalOnBlurHandler,
    onChangeInputHnadler: postalChangeHandler,
    hasError: postalHasError,
    setIsTouched: setPostalIsTouched,
    valueIsValid: postalIsValid,
    reset: resetPostal,
  } = useInput((val) => {
    return val.trim().length !== 3 });

  const {
    value: contactValue,
    onBlurHandler: contactOnBlurHandler,
    onChangeInputHnadler: contactChangeHandler,
    hasError: contactHasError,
    setIsTouched: setContactIsTouched,
    valueIsValid: contactIsValid,
    reset: resetContact,
  } = useInput((val) => val.trim() !== "");

  const onSubmitHandler = (e) => {
    e.preventDefault();

    setNameIsTouched(true);
    setBrgyIsTouched(true);
    setCityIsTouched(true);
    setProvinceIsTouched(true);
    setPostalIsTouched(true);
    setContactIsTouched(true);

    if (
      !nameIsValid ||
      !brgyIsValid ||
      !cityIsValid ||
      !provinceIsValid ||
      !postalIsValid ||
      !contactIsValid
    )
      return;

    resetName();
    resetBrgy();
    resetCity();
    resetProvince();
    resetPostal();
    resetContact();
  };

  return (
    <form className={style.form} onSubmit={onSubmitHandler}>
      <div className={`${style.control} ${nameHasError && style.invalid}`}>
        <label htmlFor="name">Fullname</label>
        <input
          value={nameValue}
          onBlur={nameOnBlurHandler}
          onChange={nameChangeHandler}
          type="text"
          id="name"
        />
        {nameHasError && (
          <p className={style.invalid}>Please Enter a valid Name!</p>
        )}
      </div>
      <div className={`${style.control} ${brgyHasError && style.invalid}`}>
        <label htmlFor="brgy">Barangay</label>
        <input
          value={brgyValue}
          onBlur={brgyOnBlurHandler}
          onChange={brgyChangeHandler}
          type="text"
          id="brgy"
        />
        {brgyHasError && <p className={style.invalid}>Invalid!</p>}
      </div>
      <div className={`${style.control} ${cityHasError && style.invalid}`}>
        <label htmlFor="city">City</label>
        <input
          value={cityValue}
          onBlur={cityOnBlurHandler}
          onChange={cityChangeHandler}
          type="text"
          id="city"
        />
        {cityHasError && <p className={style.invalid}>Invalid City!</p>}
      </div>
      <div className={`${style.control} ${provinceHasError && style.invalid}`}>
        <label htmlFor="province">Province</label>
        <input
          value={provinceValue}
          onBlur={provinceOnBlurHandler}
          onChange={provinceChangeHandler}
          type="text"
          id="province"
        />
        {provinceHasError && <p className={style.invalid}>Invlid Province!</p>}
      </div>
      <div className={`${style.control} ${postalHasError && style.invalid}`}>
        <label htmlFor="postal">Postal Code</label>
        <input
          value={postalValue}
          onBlur={postalOnBlurHandler}
          onChange={postalChangeHandler}
          type="text"
          id="postal"
        />
        {postalHasError && <p className={style.invalid}>Please Enter a valid Postal Code!</p>}
      </div>
      <div className={`${style.control} ${contactHasError && style.invalid}`}>
        <label htmlFor="contact">Phone/Mobile</label>
        <input
          value={contactValue}
          onBlur={contactOnBlurHandler}
          onChange={contactChangeHandler}
          type="text"
          id="contact"
        />
        {contactHasError && <p className={style.invalid}>Please Enter a contact!</p>}
      </div>

      <div className={style.actions}>
        <Button type="button" onClick={props.onClose}>
          Cancel
        </Button>
        <Button className={style.submit}>Submit</Button>
      </div>
    </form>
  );
};

export default Checkout;
